    private static function getQueryDate(){
        return strval(date('d/m/Y', time() - 18000));
    }

    private function getListCredits(string $query_date){
        try {
            $response = Http::post(env('FACES_LIST_CREDITS'), [
                'credFechaConsulta' => $query_date
            ]);

            Log::channel('credits')->info($response);

            if ($response->failed()) {
                Log::channel('credits')->error("Error en la peticin HTTP a FACES_LIST_CREDITS", [
                    'status' => $response->status()
                ]);
                return null;
            }

            $data = json_decode($response)->ListaCreditosSEFIL;

            if ($data === null) {
                Log::channel('credits')->warning("La respuesta de FACES_LIST_CREDITS es null o JSON invlido", [
                    'status' => $response->status()
                ]);
                return null;
            }

            return $data;

        } catch (\Exception $e) {
            Log::channel('credits')->error("Excepcin al obtener lista de crditos: " . $e->getMessage(), [
                'query_date' => $query_date
            ]);
            return null;
        }
    }

