        }
    }

    private function getListPays(string $query_date, string $sync_id){
        try {
            $response = Http::post(env('FACES_LIST_PAYS'), [
                'credNumeroOperacion' => $query_date,
                'credFechaConsulta' => $sync_id
            ]);

            if ($response->failed()) {
                Log::channel('credits')->error("Error en la peticin HTTP a FACES_LIST_PAYS", [
                    'status' => $response->status()
                ]);
                return null;
            }

            $data = json_decode($response)->ListaPagosSEFIL;

            if ($data === null) {
                Log::channel('credits')->warning("La respuesta de FACES_LIST_PAYS es null o JSON invlido", [
                    'status' => $response->status()
                ]);
                return null;
            }

            return $data;

        } catch (\Exception $e) {
            Log::channel('credits')->error("Excepcin al obtener lista de pagos: " . $e->getMessage(), [
                'query_date' => $query_date,
                'sync_id' => $sync_id
            ]);
            return null;
        }
    }

    public function syncCredits(){
        Log::channel('credits')->info("-----------------------------------------------------------------------");
        Log::channel('credits')->info($this::getQueryDate());
        $credits = $this->getListCredits($this::getQueryDate());

        $batchSize = 500;
        $totalCredits = count($credits);
        $created = 0;
        $updated = 0;
        $errors = 0;

        $contactsCreated = 0;
        $contactsUpdated = 0;
        $phonesCreated = 0;
        $addressesCreated = 0;
        $relationshipsCreated = 0;
        $contactErrors = 0;

        Log::channel('credits')->info("Iniciando sincronizacin de {$totalCredits} crditos");
        Log::channel('credits')->info(json_encode($credits));

        try {
            DB::beginTransaction();

            foreach (array_chunk($credits, $batchSize) as $batch) {
                $syncIds = array_map(function($credit) {
                    return is_object($credit) ? $credit->sync_id : $credit['sync_id'];
                }, $batch);
                
                $existingCredits = DB::table(env('SCHEMA_API_CREDIT'))
                    ->whereIn('sync_id', $syncIds)
                    ->pluck('sync_id')
                    ->toArray();
                
                $toUpdate = [];
                $toInsert = [];
                $now = now();

                foreach ($batch as $creditData) {
                    $data = [
                        'sync_id' => $creditData->sync_id,
                        'monthly_fee_amount' => $creditData->monthly_fee_amount ?? 0.0,
                        'total_amount' => $creditData->total_amount ?? 0.0,
                        'paid_fees' => $creditData->paid_fees ?? 0,
                        'pending_fees' => $creditData->pending_fees ?? 0,
                        'total_fees' => $creditData->total_fees ?? 0,
                        'agency' => $creditData->Agencia ?? '',
                        'collection_state' => $creditData->collertion_state ?? '',
                        'days_past_due' => $creditData->days_past_due ?? 0,
                        'payment_date' => $creditData->payment_date ?? null,
                        'award_date' => $creditData->award_date ?? null,
                        'due_date' => $creditData->due_date ?? null,
                        'frequency' => $creditData->frequency ?? '',
                        // 'valor_org' => $creditData->valor_org ?? 0.0,
                        'capital' => $creditData->saldo_capital ?? 0.0,
                        'interest' => $creditData->interes ?? 0.0,
                        'mora' => $creditData->mora ?? 0.0,
                        'safe' => $creditData->seguro_desgravamen ?? 0.0,
                        'collection_expenses' => $creditData->gastos_cobranza ?? 0.0,
                        'legal_expenses' => $creditData->gastos_judiciales ?? 0.0,
                        'other_values' => $creditData->otros_valores ?? 0.0,
                        'date_offer' => $creditData->oferta ?? '',
                        'date_promise' => $creditData->compromiso ?? '',
                        'date_notification' => $creditData->notificacion ?? '',
                        'business_id' => 3
                    ];

                    if (in_array($creditData->sync_id, $existingCredits)) {
                        $data['updated_at'] = $now;
                        $toUpdate[] = $data;
                    } else {
                        $data['created_at'] = $now;
                        $data['updated_at'] = $now;
                        $toInsert[] = $data;
                    }
                }

                if (!empty($toInsert)) {
                    DB::table(env('SCHEMA_API_CREDIT'))->insert($toInsert);
                    $created += count($toInsert);
                }

                foreach ($toUpdate as $updateData) {
                    DB::table(env('SCHEMA_API_CREDIT'))
                        ->where('sync_id', $updateData['sync_id'])
                        ->update($updateData);
                    $updated++;
                }

                $contactStats = $this->syncContactsForBatch($batch);
                $contactsCreated += $contactStats['clients_created'];
                $contactsUpdated += $contactStats['clients_updated'];
                $phonesCreated += $contactStats['phones_created'];
                $addressesCreated += $contactStats['addresses_created'];
                $relationshipsCreated += $contactStats['relationships_created'];
                $contactErrors += $contactStats['errors'];

                Log::channel('credits')->info("Procesados {$created} creados, {$updated} actualizados de {$totalCredits}");
            }

            Log::channel('credits')->info("-----------------------------------------------------------------------");
            DB::commit();

            return [
                'success' => true,
                'credits' => [
                    'created' => $created,
                    'updated' => $updated,
                    'total' => $totalCredits,
                    'errors' => $errors
                ],
                'contacts' => [
                    'clients_created' => $contactsCreated,
                    'clients_updated' => $contactsUpdated,
                    'phones_created' => $phonesCreated,
                    'addresses_created' => $addressesCreated,
                    'relationships_created' => $relationshipsCreated,
                    'errors' => $contactErrors
                ]
            ];

        } catch (Exception $e) {
            DB::rollBack();
            Log::channel('credits')->error('Error sincronizando crditos: ' . $e->getMessage());
            
            return [
                'success' => false,
                'error' => $e->getMessage(),
                'credits' => [
                    'created' => $created,
                    'updated' => $updated
                ],
                'contacts' => [
                    'clients_created' => $contactsCreated,
                    'clients_updated' => $contactsUpdated,
                    'phones_created' => $phonesCreated,
                    'addresses_created' => $addressesCreated,
                    'relationships_created' => $relationshipsCreated,
                    'errors' => $contactErrors
                ]
            ];
        }
    }
    
    private function syncContactsForBatch(array $batch)
    {
        $stats = [
            'clients_created' => 0,
            'clients_updated' => 0,
            'phones_created' => 0,
            'addresses_created' => 0,
            'relationships_created' => 0,
            'errors' => 0
        ];

        $allContacts = [];
        foreach ($batch as $creditData) {
            try {
                $contacts = $this->getListContacts($creditData->sync_id);

                if ($contacts === null || !is_array($contacts)) {
                    Log::channel('credits')->warning("No contacts returned for credit", [
                        'sync_id' => $creditData->sync_id
                    ]);
                    $stats['errors']++;
                    continue;
                }

                foreach ($contacts as $contact) {
                    $contact->credit_sync_id = $creditData->sync_id;
                    $allContacts[] = $contact;
                }

            } catch (\Exception $e) {
                Log::channel('credits')->error("Error fetching contacts for credit", [
                    'sync_id' => $creditData->sync_id,
                    'error' => $e->getMessage()
                ]);
                $stats['errors']++;
                continue;
            }
        }

        if (empty($allContacts)) {
            Log::channel('credits')->info("No contacts to process for this batch");
            return $stats;
        }

        Log::channel('credits')->info("Processing " . count($allContacts) . " contacts for batch");

        $clientsByCi = [];
        foreach ($allContacts as $contact) {
            $ci = $contact->documento ?? null;

            if (empty($ci)) {
                Log::channel('credits')->warning("Contact without CI, skipping", [
                    'sync_client_id' => $contact->sync_client_id ?? 'unknown'
                ]);
                continue;
            }

            if (!isset($clientsByCi[$ci])) {
                $clientsByCi[$ci] = $contact;
            }
        }

        $existingClients = DB::table(env('SCHEMA_API_CLIENT'))
            ->whereIn('ci', array_keys($clientsByCi))
            ->get()
            ->keyBy('ci');

        $clientsToInsert = [];
        $clientsToUpdate = [];
        $now = now();

        foreach ($clientsByCi as $ci => $contact) {
            $clientData = [
                'name' => $contact->fullName ?? '',
                'ci' => $ci,
                'gender' => $contact->Sexo ?? null,
                'civil_status' => $contact->Estado_civil ?? null,
                'economic_activity' => $contact->sector_economico ?? null,
            ];

            if ($existingClients->has($ci)) {
                $clientData['updated_at'] = $now;
                $clientsToUpdate[] = $clientData;
            } else {
                $clientData['created_at'] = $now;
                $clientData['updated_at'] = $now;
                $clientsToInsert[] = $clientData;
            }
        }

        if (!empty($clientsToInsert)) {
            DB::table(env('SCHEMA_API_CLIENT'))->insert($clientsToInsert);
            $stats['clients_created'] = count($clientsToInsert);
        }

        foreach ($clientsToUpdate as $clientData) {
            DB::table(env('SCHEMA_API_CLIENT'))
                ->where('ci', $clientData['ci'])
                ->update($clientData);
            $stats['clients_updated']++;
        }

        $clients = DB::table(env('SCHEMA_API_CLIENT'))
            ->whereIn('ci', array_keys($clientsByCi))
            ->get()
            ->keyBy('ci');

        Log::channel('credits')->info("Clients processed", [
            'created' => $stats['clients_created'],
            'updated' => $stats['clients_updated']
        ]);

        $phonesToInsert = [];

        foreach ($allContacts as $contact) {
            $ci = $contact->documento ?? null;
            if (empty($ci) || !$clients->has($ci)) {
                continue;
            }

            $clientId = $clients->get($ci)->id;

            if (!empty($contact->mobile_phones)) {
                $mobilePhones = array_filter(
                    array_map('trim', explode(',', $contact->mobile_phones)),
                    function($phone) { return !empty($phone); }
                );

                foreach ($mobilePhones as $phone) {
                    $phonesToInsert[] = [
                        'client_id' => $clientId,
                        'phone_status'=>'ACTIVE',
                        'phone_number' => $phone,
                        'phone_type' => 'MVIL',
                        'created_at' => $now,
                        'updated_at' => $now
                    ];
                }
            }

            if (!empty($contact->landline_phones)) {
                $landlinePhones = array_filter(
                    array_map('trim', explode(',', $contact->landline_phones)),
                    function($phone) { return !empty($phone); }
                );

                foreach ($landlinePhones as $phone) {
                    $phonesToInsert[] = [
                        'client_id' => $clientId,
                        'phone_status'=>'ACTIVE',
                        'phone_number' => $phone,
                        'phone_type' => 'FIJO',
                        'created_at' => $now,
                        'updated_at' => $now
                    ];
                }
            }
        }

        if (!empty($phonesToInsert)) {
            $clientIds = array_unique(array_column($phonesToInsert, 'client_id'));
            $existingPhones = DB::table(env('SCHEMA_API_CONTACT'))
                ->whereIn('client_id', $clientIds)
                ->get()
                ->map(function($phone) {
                    return $phone->client_id . '|' . $phone->phone_number;
                })
                ->toArray();

            $existingPhonesSet = array_flip($existingPhones);
            
            $phonesToInsert = array_filter($phonesToInsert, function($phone) use ($existingPhonesSet) {
                $key = $phone['client_id'] . '|' . $phone['phone_number'];
                return !isset($existingPhonesSet[$key]);
            });

            if (!empty($phonesToInsert)) {
                DB::table(env('SCHEMA_API_CONTACT'))->insert($phonesToInsert);
                $stats['phones_created'] = count($phonesToInsert);
            }
        }

        Log::channel('credits')->info("Phones processed", [
            'created' => $stats['phones_created']
        ]);

        $addressesToInsert = [];

        foreach ($allContacts as $contact) {
            $ci = $contact->documento ?? null;
            if (empty($ci) || !$clients->has($ci)) {
                continue;
            }

            $clientId = $clients->get($ci)->id;

            if (!empty($contact->direccion_domicilio) && is_object($contact->direccion_domicilio)) {
                $addr = $contact->direccion_domicilio;
                $addressesToInsert[] = [
                    'client_id' => $clientId,
                    'type' => 'DOMICILIO',
                    'address' => $addr->address ?? null,
                    'province' => $addr->province ?? null,
                    'canton' => $addr->canton ?? null,
                    'parish' => $addr->parroquia ?? null,
                    'neighborhood' => $addr->neighborhood ?? null,
                    'latitude' => $addr->latitude ?? null,
                    'longitude' => $addr->length ?? null,
                    'created_at' => $now,
                    'updated_at' => $now
                ];
            }

            if (!empty($contact->direccion_trabajo) && is_object($contact->direccion_trabajo)) {
                $addr = $contact->direccion_trabajo;
                $addressesToInsert[] = [
                    'client_id' => $clientId,
                    'type' => 'TRABAJO',
                    'address' => $addr->address ?? null,
                    'province' => $addr->province ?? null,
                    'canton' => $addr->canton ?? null,
                    'parish' => $addr->parroquia ?? null,
                    'neighborhood' => $addr->neighborhood ?? null,
                    'latitude' => $addr->latitude ?? null,
                    'longitude' => $addr->length ?? null,
                    'created_at' => $now,
                    'updated_at' => $now
                ];
            }
        }

        if (!empty($addressesToInsert)) {
            $clientIds = array_unique(array_column($addressesToInsert, 'client_id'));
            $existingAddresses = DB::table(env('SCHEMA_API_DIRECTION'))
                ->whereIn('client_id', $clientIds)
                ->get()
                ->keyBy(function($addr) {
                    return $addr->client_id . '|' . $addr->type;
                });

            $toInsert = [];
            $toUpdate = [];

            foreach ($addressesToInsert as $addr) {
                $key = $addr['client_id'] . '|' . $addr['type'];

                if ($existingAddresses->has($key)) {
                    // Existe, verificar si los datos son diferentes
                    $existing = $existingAddresses->get($key);

                    $hasChanges = (
                        $existing->address !== $addr['address'] ||
                        $existing->province !== $addr['province'] ||
                        $existing->canton !== $addr['canton'] ||
                        $existing->parish !== $addr['parish'] ||
                        $existing->neighborhood !== $addr['neighborhood'] ||
                        $existing->latitude !== $addr['latitude'] ||
                        $existing->longitude !== $addr['longitude']
                    );

                    if ($hasChanges) {
                        // Solo actualizar si hay cambios
                        $toUpdate[] = [
                            'client_id' => $addr['client_id'],
                            'type' => $addr['type'],
                            'address' => $addr['address'],
                            'province' => $addr['province'],
                            'canton' => $addr['canton'],
                            'parish' => $addr['parish'],
                            'neighborhood' => $addr['neighborhood'],
                            'latitude' => $addr['latitude'],
                            'longitude' => $addr['longitude'],
                            'updated_at' => $now
                        ];
                    }
                    // Si no hay cambios, skip (no hacer nada)
                } else {
                    // No existe, insertar
                    $toInsert[] = $addr;
                }
            }

            // Bulk insert de direcciones nuevas
            if (!empty($toInsert)) {
                DB::table(env('SCHEMA_API_DIRECTION'))->insert($toInsert);
                $stats['addresses_created'] = count($toInsert);
            }

            // Update de direcciones con datos diferentes
            foreach ($toUpdate as $updateData) {
                DB::table(env('SCHEMA_API_DIRECTION'))
                    ->where('client_id', $updateData['client_id'])
                    ->where('type', $updateData['type'])
                    ->update([
                        'address' => $updateData['address'],
                        'province' => $updateData['province'],
                        'canton' => $updateData['canton'],
                        'parish' => $updateData['parish'],
                        'neighborhood' => $updateData['neighborhood'],
                        'latitude' => $updateData['latitude'],
                        'longitude' => $updateData['longitude'],
                        'updated_at' => $updateData['updated_at']
                    ]);
            }

            if (!empty($toUpdate)) {
                Log::channel('credits')->info("Updated " . count($toUpdate) . " addresses with new data");
            }
        }

        Log::channel('credits')->info("Addresses processed", [
            'created' => $stats['addresses_created']
        ]);

        // FASE 5: Relaciones Client-Credit
        $relationshipsMap = []; // Usar map para evitar duplicados

        $creditSyncIds = array_unique(array_map(function($contact) {
            return $contact->credit_sync_id;
        }, $allContacts));

        $creditsBySyncId = DB::table(env('SCHEMA_API_CREDIT'))
            ->whereIn('sync_id', $creditSyncIds)
            ->get()
            ->keyBy('sync_id');

        foreach ($allContacts as $contact) {
            $ci = $contact->documento ?? null;
            $creditSyncId = $contact->credit_sync_id ?? null;

            if (empty($ci) || empty($creditSyncId)) {
                continue;
            }

            if (!$clients->has($ci)) {
                Log::channel('credits')->warning("Client not found for relationship", [
                    'ci' => $ci,
                    'credit_sync_id' => $creditSyncId
                ]);
                continue;
            }

            if (!$creditsBySyncId->has($creditSyncId)) {
                Log::channel('credits')->warning("Credit not found for relationship", [
                    'credit_sync_id' => $creditSyncId
                ]);
                continue;
            }

            $clientId = $clients->get($ci)->id;
            $creditId = $creditsBySyncId->get($creditSyncId)->id;
            $type = $contact->type ?? 'TITULAR';

            // Usar clave nica para evitar duplicados en el array
            $key = $clientId . '|' . $creditId;

            // Solo agregar si no existe o actualizar el type (el ltimo prevalece)
            if (!isset($relationshipsMap[$key])) {
                $relationshipsMap[$key] = [
                    'client_id' => $clientId,
                    'credit_id' => $creditId,
                    'type' => $type,
                    'created_at' => $now,
                    'updated_at' => $now
                ];
            } else {
                // Si ya existe en el array, actualizar el type (ltimo prevalece)
                $relationshipsMap[$key]['type'] = $type;
                $relationshipsMap[$key]['updated_at'] = $now;
            }
        }

        $relationshipsToInsert = array_values($relationshipsMap);

        if (!empty($relationshipsToInsert)) {
            $clientIds = array_unique(array_column($relationshipsToInsert, 'client_id'));
            $creditIds = array_unique(array_column($relationshipsToInsert, 'credit_id'));

            // Obtener relaciones existentes (constraint unique en client_id + credit_id)
            $existingRelationships = DB::table('client_credit')
                ->whereIn('client_id', $clientIds)
                ->whereIn('credit_id', $creditIds)
                ->get()
                ->keyBy(function($rel) {
                    return $rel->client_id . '|' . $rel->credit_id;
                });

            $toInsert = [];
            $toUpdate = [];

            foreach ($relationshipsToInsert as $rel) {
                $key = $rel['client_id'] . '|' . $rel['credit_id'];

                if ($existingRelationships->has($key)) {
                    // Si existe, actualizar el type si es diferente
                    $existing = $existingRelationships->get($key);
                    if ($existing->type !== $rel['type']) {
                        $toUpdate[] = [
                            'client_id' => $rel['client_id'],
                            'credit_id' => $rel['credit_id'],
                            'type' => $rel['type'],
                            'updated_at' => $now
                        ];
                    }
                } else {
                    // Si no existe, insertar
                    $toInsert[] = $rel;
                }
            }

            // Bulk insert de nuevas relaciones
            if (!empty($toInsert)) {
                DB::table('client_credit')->insert($toInsert);
                $stats['relationships_created'] = count($toInsert);
            }

            // Update de relaciones existentes con type diferente
            foreach ($toUpdate as $updateData) {
                DB::table('client_credit')
                    ->where('client_id', $updateData['client_id'])
                    ->where('credit_id', $updateData['credit_id'])
                    ->update([
                        'type' => $updateData['type'],
                        'updated_at' => $updateData['updated_at']
                    ]);
            }

            if (!empty($toUpdate)) {
                Log::channel('credits')->info("Updated " . count($toUpdate) . " relationship types");
            }
        }

        Log::channel('credits')->info("Contact sync completed for batch", $stats);

        return $stats;
    }

    /**
     * Sincronizar pagos desde la API FACES
     *
     * @return array Estadsticas de sincronizacin de pagos
     */
    public function syncPays()
    {
        Log::channel('credits')->info("Iniciando sincronizacin de pagos");

        $currently_month = date('m');
        $last_month = strval(intval($currently_month) - 1);
        $currently_year = date('Y');
        // Con esto bscamos pagos con crditos que se inactivaron en la anterior campaa
        $queryDate = "01/{$last_month}/{$currently_year}";
        $currentlyQueryDate = $this::getQueryDate();

        $credits = DB::table(env('SCHEMA_API_CREDIT'))
            ->where('last_sync_date','>=', $queryDate)
            ->where('business_id', env('BUSINESS_ID'))
            ->get()
            ->toArray();

        if (empty($credits)) {
            Log::channel('credits')->warning("No se encontraron crditos para sincronizar pagos");
            return [
                'success' => false,
                'message' => 'No se encontraron crditos para sincronizar pagos',
                'payments_created' => 0
            ];
        }

        $batchSize = 500;
        $totalPaymentsCreated = 0;
        $totalPaymentsSkipped = 0;
        $errors = 0;

        try {
            DB::beginTransaction();

            foreach (array_chunk($credits, $batchSize) as $batch) {
                $allPayments = [];

                // Recolectar pagos de todos los crditos en el batch
                foreach ($batch as $credit) {
                    try {
                        // Ya tenemos el credit_id porque obtuvimos los crditos de la BD
                        $creditId = $credit->id;

                        $payments = $this->getListPays($credit->sync_id, $currentlyQueryDate);

                        if ($payments === null || !is_array($payments)) {
                            Log::channel('credits')->warning("No payments returned for credit", [
                                'sync_id' => $credit->sync_id
                            ]);
                            $errors++;
                            continue;
                        }

                        // Tag cada pago con el credit_id de la tabla credits
                        foreach ($payments as $payment) {
                            $payment->credit_id = $creditId;
                            $allPayments[] = $payment;
                        }

                    } catch (\Exception $e) {
                        Log::channel('credits')->error("Error fetching payments for credit", [
                            'sync_id' => $credit->sync_id,
                            'error' => $e->getMessage()
                        ]);
                        $errors++;
                        continue;
                    }
                }

                if (empty($allPayments)) {
                    Log::channel('credits')->info("No payments to process for this batch");
                    continue;
                }

                Log::channel('credits')->info("Processing " . count($allPayments) . " payments for batch");

                $paymentsMap = [];
                $now = now();

                foreach ($allPayments as $payment) {
                    $key = implode('|', [
                        $payment->credit_id ?? '',
                        $payment->fee_id ?? '',
                        $payment->payment_id ?? '',
                        $payment->payment_type ?? '',
                        $payment->payment_value ?? '',
                        $payment->payment_date ?? '',
                        $payment->capital ?? '',
                        $payment->interes ?? '',
                        $payment->interes_mora ?? '',
                        $payment->otros ?? ''
                    ]);

                    if (!isset($paymentsMap[$key])) {
                        $paymentsMap[$key] = [
                            'credit_id' => $payment->credit_id ?? null,
                            'fee_id' => $payment->fee_id ?? null,
                            'payment_id' => $payment->payment_id ?? null,
                            'payment_type' => $payment->payment_type ?? null,
                            'payment_value' => $payment->payment_value ?? null,
                            'payment_date' => $payment->payment_date ?? null,
                            'capital' => $payment->capital ?? null,
                            'interest' => $payment->interes ?? null,
                            'mora' => $payment->interes_mora ?? null,
                            'other_values' => $payment->otros ?? null,
                            'created_at' => $now,
                            'updated_at' => $now
                        ];
                    }
                }

                $paymentsToInsert = array_values($paymentsMap);
                $existingPaymentsQuery = DB::table('payments');

                foreach ($paymentsToInsert as $payment) {
                    $existingPaymentsQuery->orWhere(function($query) use ($payment) {
                        $query->where('credit_id', $payment['credit_id'])
                            ->where('fee_id', $payment['fee_id'])
                            ->where('payment_id', $payment['payment_id'])
                            ->where('payment_type', $payment['payment_type'])
                            ->where('payment_value', $payment['payment_value'])
                            ->where('payment_date', $payment['payment_date'])
                            ->where('capital', $payment['capital'])
                            ->where('interest', $payment['interest'])
                            ->where('mora', $payment['mora'])
                            ->where('other_values', $payment['other_values']);
                    });
                }

                $existingPayments = $existingPaymentsQuery
                    ->get()
                    ->map(function($pay) {
                        return implode('|', [
                            $pay->credit_id,
                            $pay->fee_id,
                            $pay->payment_id,
                            $pay->payment_type,
                            $pay->payment_value,
                            $pay->payment_date,
                            $pay->capital,
                            $pay->interest,
                            $pay->mora,
                            $pay->other_values
                        ]);
                    })
                    ->toArray();

                $existingPaymentsSet = array_flip($existingPayments);

                // Filtrar solo los pagos que NO existen
                $toInsert = [];
                foreach ($paymentsToInsert as $payment) {
                    $key = implode('|', [
                        $payment['credit_id'],
                        $payment['fee_id'],
                        $payment['payment_id'],
                        $payment['payment_type'],
                        $payment['payment_value'],
                        $payment['payment_date'],
                        $payment['capital'],
                        $payment['interest'],
                        $payment['mora'],
                        $payment['other_values']
                    ]);

                    if (!isset($existingPaymentsSet[$key])) {
                        $toInsert[] = $payment;
                    } else {
                        $totalPaymentsSkipped++;
                    }
                }

                // Bulk insert de pagos nuevos
                if (!empty($toInsert)) {
                    DB::table(env('SCHEMA_API_PAYS'))->insert($toInsert);
                    $totalPaymentsCreated += count($toInsert);
                    Log::channel('credits')->info("Inserted " . count($toInsert) . " new payments");
                }
            }

            DB::commit();

            Log::channel('credits')->info("Payment sync completed", [
                'created' => $totalPaymentsCreated,
                'skipped' => $totalPaymentsSkipped,
                'errors' => $errors
            ]);

            return [
                'success' => true,
                'payments_created' => $totalPaymentsCreated,
                'payments_skipped' => $totalPaymentsSkipped,
                'errors' => $errors
            ];

        } catch (\Exception $e) {
            DB::rollBack();
            Log::channel('credits')->error('Error sincronizando pagos: ' . $e->getMessage());

            return [
                'success' => false,
                'error' => $e->getMessage(),
                'payments_created' => $totalPaymentsCreated,
                'payments_skipped' => $totalPaymentsSkipped,
                'errors' => $errors
            ];
        }
    }

    //  Para testear sin conexin a FACES
    public function getCreditsToSync($date){
        $credits = $this->getDataTest();
        return json_decode($credits);
    }
